class Command(BaseCommand):
    help = 'Data insert'

    def handle(self, *args, **options):
        print("Starting insert")
        data = email_str.split(',')
        for data_item in data:
            full_name = data_item.replace(' ', '').split('@', -1)[:-1]
            full_name_data = full_name[0].replace('.', ' ').title()
            print(full_name_data, data_item, '', 'Azerbaijan European School')
            try:
                EmailData.objects.create(full_name=full_name_data, email=data_item, phone='', category='Azerbaijan European School')
                self.stdout.write('Email -- "%s" insert.' % data_item)
            except:
                self.stdout.write('Email -- "%s" not insert.' % data_item)
        print("Exited .")
